const mailConfig = require('./config/mail.json');
const nodemailer = require('nodemailer');
const mailHtml = '<!DOCTYPE html>\n' +
    '<html lang="fr">\n' +
    '<head>\n' +
    '    <meta charset="UTF-8">\n' +
    '</head>\n' +
    '<body>\n' +
    '  <style>\n' +
    '    body{\n' +
    '      background-color: #D3D3D3;\n' +
    '      display:flex;\n' +
    '      flex-direction: column;\n' +
    '      justify-content:center;\n' +
    '      align-items:center;\n' +
    '      width:100vw;\n' +
    '      height:100vh;\n' +
    '      min-height:500px;\n' +
    '    }\n' +
    '\n' +
    '    #page{\n' +
    '      background-color:#F5F5F5;\n' +
    '      border-radius:10px;\n' +
    '      width:calc(90vw - 20px);\n' +
    '      max-width:780px;\n' +
    '      padding:10px;\n' +
    '    }\n' +
    '\n' +
    '    #contenu{\n' +
    '      display:flex;\n' +
    '      flex-direction:column;\n' +
    '      justify-content:center;\n' +
    '      align-items:center;\n' +
    '      min-height:100px;\n' +
    '    }\n' +
    '\n' +
    '    h1, h2, p, a{\n' +
    '      font-family: Arial,serif;\n' +
    '    }\n' +
    '\n' +
    '    h1{\n' +
    '      text-decoration: underline;\n' +
    '    }\n' +
    '\n' +
    '    h1, h2{\n' +
    '      text-align: center;\n' +
    '      margin:10px 0 0 0;\n' +
    '    }\n' +
    '\n' +
    '    #logo{\n' +
    '      width:18vw;\n' +
    '      max-width:160px;\n' +
    '    }\n' +
    '  </style>\n' +
    '\n' +
    '  <img id="logo" alt="logo de Noobnotes" src="data:image/png;base64,">\n' +
    '  <div id="page">\n' +
    '    <h1>Noobnotes</h1>\n' +
    '    <h2>{{subject}}</h2>\n' +
    '    <div id="contenu">\n' +
    '      <p>{{contenu}}</p>\n' +
    '    </div>\n' +
    '  </div>\n' +
    '</body>\n' +
    '</html>';

let transporter = nodemailer.createTransport({
    host: mailConfig.host,
    port: mailConfig.port,
    secure: mailConfig.secure,
    auth: {
        user: mailConfig.user,
        pass: mailConfig.password
    }
});

exports.envoyerMailPersonne = (receipt, subject, content) => {
    const options = {
        from: mailConfig.user,
        to: receipt,
        subject: subject,
        html: mailHtml.replace('{{subject}}', subject).replace('{{contenu}}', content)
    }

    transporter.sendMail(options, (error) => {
       if(error){
           throw new error;
       }
    });
};

exports.envoyerMailGroupe = (groupe, subject, content) => {
    const options = {
        from: mailConfig.user,
        bcc: groupe,
        subject: subject,
        html: mailHtml.replace('{{subject}}', subject).replace('{{contenu}}', content)
    }

    transporter.sendMail(options, (error) => {
        if(error){
            throw new error;
        }
    });
};